otball world cup 2017','','inherit','closed','closed','','33-revision-v1','','','2017-10-11 08:10:17','2017-10-11 08:10:17','',33,'http://localhost/wordpress/?p=34',0,'revision','',0),(35,1,'2017-10-11 08:14:27','2017-10-11 08:14:27','<div class=\"wrapper clearfix article-content-wrapper\">\r\n<div class=\"main-content\"><section class=\"title_section clearfix\">\r\n<h1 class=\"heading1\" data-articletitle=\"\">Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley</h1>\r\n</section><section class=\"highlight clearfix\">\r\n<h4 class=\"heading4\">Highlights</h4>\r\n<div id=\"mCSB_1\" class=\"mCustomScrollBox mCS-dark\">\r\n<div class=\"mCSB_container mCS_no_scrollbar\">\r\n<ul>\r\n 	<li>In its judgement in August SC decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution</li>\r\n 	<li>The judgement has been interpreted by many as a setback to the Aadhar card but Jaitley said exception had been carved out specifically to protect Aadhar</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<span class=\"img_cptn\">Arun Jaitley at Colombia University in New York (PTI image)</span>\r\n\r\n</section>\r\n<div class=\"article_content clearfix\">\r\n<div class=\"section1\">\r\n<div class=\"Normal\">\r\n\r\nWASHINGTON: The recent <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Supreme-Court\">Supreme Court</a> order on the <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/right-to-privacy\">right to privacy</a> lays down the correct exemptions which protects Aadhaar, finance minister <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Arun-Jaitley\">Arun Jaitley</a> has said.\r\n\r\nJaitley, who is in the US to attend the annual meetings of the IMF and the World Bank, was responding to a question at the prestigious <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Columbia-University\">Columbia University</a> on how the government is planning to handle Aadhaar after the recent Supreme Court decision on the right to privacy.\r\n\r\nIn its judgment in August, a nine-judge bench decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution.\r\n\r\nThe judgment has been interpreted by many as a setback to the Aadhaar card, under which the government collects vital personal information of the citizens.\r\n\r\n\"I do believe that the Supreme Court judgment on the privacy matter in accordance with the current timing is a correct judgement. It lays down the correct exceptions which protects Aadhaar,\" Jaitley told students.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley','','publish','open','open','','supreme-courts-judgment-on-privacy-protects-aadhaar-arun-jaitley','','','2017-10-12 05:57:36','2017-10-12 05:57:36','',0,'http://localhost/wordpress/?p=35',0,'post','',0),(36,1,'2017-10-11 08:14:27','2017-10-11 08:14:27','<div class=\"wrapper clearfix article-content-wrapper\">\r\n<div class=\"main-content\"><section class=\"title_section clearfix\">\r\n<h1 class=\"heading1\" data-articletitle=\"\">Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley</h1>\r\n<div class=\"brandwire_txt\"></div>\r\n<span class=\"time_cptn\">PTI | Updated: Oct 11, 2017, 13:28 IST</span>\r\n<div class=\"leftsocial sticky\"></div>\r\n<div class=\"topsocial actions\"></div>\r\n</section>\r\n<div id=\"div-gpt-ad-1994947675375-0-61034465\" data-size=\"[660,90]\" data-google-query-id=\"CLGl0I-Q6NYCFZGoaAodcQ0GAg\">\r\n<div id=\"google_ads_iframe_/7176/TOI/TOI_India/TOI_ROS_TOP_IND_AS_660_0__container__\"><iframe id=\"google_ads_iframe_/7176/TOI/TOI_India/TOI_ROS_TOP_IND_AS_660_0\" title=\"3rd party ad content\" name=\"google_ads_iframe_/7176/TOI/TOI_India/TOI_ROS_TOP_IND_AS_660_0\" width=\"660\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" data-mce-fragment=\"1\"></iframe></div>\r\n</div>\r\n<section class=\"highlight clearfix\">\r\n<h4 class=\"heading4\">Highlights</h4>\r\n<div id=\"mCSB_1\" class=\"mCustomScrollBox mCS-dark\">\r\n<div class=\"mCSB_container mCS_no_scrollbar\">\r\n<ul>\r\n 	<li>In its judgement in August SC decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution</li>\r\n 	<li>The judgement has been interpreted by many as a setback to the Aadhar card but Jaitley said exception had been carved out specifically to protect Aadhar</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<img title=\"Arun Jaitley at Colombia University in New York (PTI image)\" src=\"https://timesofindia.indiatimes.com/thumb/msid-61034468,width-400,resizemode-4/61034468.jpg\" alt=\"Arun Jaitley at Colombia University in New York (PTI image)\" data-imgid=\"61034468\" /><span class=\"img_cptn\">Arun Jaitley at Colombia University in New York (PTI image)</span></section>\r\n<div class=\"article_content clearfix\">\r\n<div class=\"section1\">\r\n<div class=\"Normal\">WASHINGTON: The recent <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Supreme-Court\">Supreme Court</a> order on the <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/right-to-privacy\">right to privacy</a> lays down the correct exemptions which protects Aadhaar, finance minister <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Arun-Jaitley\">Arun Jaitley</a> has said.\r\n\r\nJaitley, who is in the US to attend the annual meetings of the IMF and the World Bank, was responding to a question at the prestigious <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Columbia-University\">Columbia University</a> on how the government is planning to handle Aadhaar after the recent Supreme Court decision on the right to privacy.\r\n\r\nIn its judgment in August, a nine-judge bench decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution.\r\n\r\nThe judgment has been interpreted by many as a setback to the Aadhaar card, under which the government collects vital personal information of the citizens.\r\n\r\n\"I do believe that the Supreme Court judgment on the privacy matter in accordance with the current timing is a correct judgement. It lays down the correct exceptions which protects Aadhaar,\" Jaitley told students.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley','','inherit','closed','closed','','35-revision-v1','','','2017-10-11 08:14:27','2017-10-11 08:14:27','',35,'http://localhost/wordpress/?p=36',0,'revision','',0),(37,1,'2017-10-11 08:14:48','2017-10-11 08:14:48','<div class=\"wrapper clearfix article-content-wrapper\">\r\n<div class=\"main-content\"><section class=\"title_section clearfix\">\r\n<h1 class=\"heading1\" data-articletitle=\"\">Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley</h1>\r\n<span class=\"time_cptn\">PTI | Updated: Oct 11, 2017, 13:28 IST</span>\r\n\r\n</section><section class=\"highlight clearfix\">\r\n<h4 class=\"heading4\">Highlights</h4>\r\n<div id=\"mCSB_1\" class=\"mCustomScrollBox mCS-dark\">\r\n<div class=\"mCSB_container mCS_no_scrollbar\">\r\n<ul>\r\n 	<li>In its judgement in August SC decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution</li>\r\n 	<li>The judgement has been interpreted by many as a setback to the Aadhar card but Jaitley said exception had been carved out specifically to protect Aadhar</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<img title=\"Arun Jaitley at Colombia University in New York (PTI image)\" src=\"https://timesofindia.indiatimes.com/thumb/msid-61034468,width-400,resizemode-4/61034468.jpg\" alt=\"Arun Jaitley at Colombia University in New York (PTI image)\" data-imgid=\"61034468\" /><span class=\"img_cptn\">Arun Jaitley at Colombia University in New York (PTI image)</span>\r\n\r\n</section>\r\n<div class=\"article_content clearfix\">\r\n<div class=\"section1\">\r\n<div class=\"Normal\">\r\n\r\nWASHINGTON: The recent <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Supreme-Court\">Supreme Court</a> order on the <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/right-to-privacy\">right to privacy</a> lays down the correct exemptions which protects Aadhaar, finance minister <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Arun-Jaitley\">Arun Jaitley</a> has said.\r\n\r\nJaitley, who is in the US to attend the annual meetings of the IMF and the World Bank, was responding to a question at the prestigious <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Columbia-University\">Columbia University</a> on how the government is planning to handle Aadhaar after the recent Supreme Court decision on the right to privacy.\r\n\r\nIn its judgment in August, a nine-judge bench decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution.\r\n\r\nThe judgment has been interpreted by many as a setback to the Aadhaar card, under which the government collects vital personal information of the citizens.\r\n\r\n\"I do believe that the Supreme Court judgment on the privacy matter in accordance with the current timing is a correct judgement. It lays down the correct exceptions which protects Aadhaar,\" Jaitley told students.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley','','inherit','closed','closed','','35-revision-v1','','','2017-10-11 08:14:48','2017-10-11 08:14:48','',35,'http://localhost/wordpress/?p=37',0,'revision','',0),(38,1,'2017-10-11 08:18:44','2017-10-11 08:18:44','<div class=\"wrapper clearfix article-content-wrapper\">\r\n<div class=\"main-content\"><section class=\"title_section clearfix\">\r\n<h1 class=\"heading1\" data-articletitle=\"\">Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley</h1>\r\n</section><section class=\"highlight clearfix\">\r\n<h4 class=\"heading4\">Highlights</h4>\r\n<div id=\"mCSB_1\" class=\"mCustomScrollBox mCS-dark\">\r\n<div class=\"mCSB_container mCS_no_scrollbar\">\r\n<ul>\r\n 	<li>In its judgement in August SC decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution</li>\r\n 	<li>The judgement has been interpreted by many as a setback to the Aadhar card but Jaitley said exception had been carved out specifically to protect Aadhar</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<img title=\"Arun Jaitley at Colombia University in New York (PTI image)\" src=\"https://timesofindia.indiatimes.com/thumb/msid-61034468,width-400,resizemode-4/61034468.jpg\" alt=\"Arun Jaitley at Colombia University in New York (PTI image)\" data-imgid=\"61034468\" /><span class=\"img_cptn\">Arun Jaitley at Colombia University in New York (PTI image)</span>\r\n\r\n</section>\r\n<div class=\"article_content clearfix\">\r\n<div class=\"section1\">\r\n<div class=\"Normal\">\r\n\r\nWASHINGTON: The recent <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Supreme-Court\">Supreme Court</a> order on the <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/right-to-privacy\">right to privacy</a> lays down the correct exemptions which protects Aadhaar, finance minister <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Arun-Jaitley\">Arun Jaitley</a> has said.\r\n\r\nJaitley, who is in the US to attend the annual meetings of the IMF and the World Bank, was responding to a question at the prestigious <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Columbia-University\">Columbia University</a> on how the government is planning to handle Aadhaar after the recent Supreme Court decision on the right to privacy.\r\n\r\nIn its judgment in August, a nine-judge bench decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution.\r\n\r\nThe judgment has been interpreted by many as a setback to the Aadhaar card, under which the government collects vital personal information of the citizens.\r\n\r\n\"I do believe that the Supreme Court judgment on the privacy matter in accordance with the current timing is a correct judgement. It lays down the correct exceptions which protects Aadhaar,\" Jaitley told students.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley','','inherit','closed','closed','','35-revision-v1','','','2017-10-11 08:18:44','2017-10-11 08:18:44','',35,'http://localhost/wordpress/?p=38',0,'revision','',0),(39,1,'2017-10-11 08:53:10','2017-10-11 08:53:10','<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry’s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\n<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry’s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with t